import React, { Component } from 'react';
import Mountain from './Mountain';
import Ourstory from './Ourstory';
import Abovefold from './Abovefold';
import Fleece from './Fleece';

const Sourcepage = ({route, onRouteChange}) => {
    return(
    <div>
        {route === 'Abovefold' && <Abovefold onRouteChange={props.onRouteChange}/>}
        {route === 'Ourstory' && <Ourstory onRouteChange={props.onRouteChange}/>}
        {route === 'Mountain' && <Mountain onRouteChange={props.onRouteChange}/>}
        {route === 'Fleece' && <Fleece onRouteChange={props.onRouteChange}/>}
    </div>
    );
}

export default Sourcepage;
